import{_ as e,c as t,a6 as r,o}from"./chunks/framework.D4mCxCc5.js";const n="data:image/png;base64,",A="/assets/3341a5467c2746cfc269f63774544d084227b34a.C-woaKJu.png",d="/assets/c60d460b2fb7680609a67b5ba0914a2004e56a89.CaFUGcBU.png",c="data:image/png;base64,",p="/assets/2e8527ef36a52316ee330749b6b8b1b30dbe4169.CDi2fc9I.png",v=JSON.parse('{"title":"环境","description":"","frontmatter":{},"headers":[],"relativePath":"Docs/Knowledge/ProgrammingLanguage/JavaScript/Environment.md","filePath":"Docs/Knowledge/ProgrammingLanguage/JavaScript/Environment.md","lastUpdated":1727457588000}'),s={name:"Docs/Knowledge/ProgrammingLanguage/JavaScript/Environment.md"};function g(l,a,u,b,i,q){return o(),t("div",null,a[0]||(a[0]=[r('<h1 id="环境" tabindex="-1">环境 <a class="header-anchor" href="#环境" aria-label="Permalink to &quot;环境&quot;">​</a></h1><h2 id="浏览器" tabindex="-1">浏览器 <a class="header-anchor" href="#浏览器" aria-label="Permalink to &quot;浏览器&quot;">​</a></h2><p>推荐使用<strong>chromegw</strong>,<strong>Edge</strong></p><p>教程中使用<strong>Edge</strong></p><p><strong>Edge</strong>是微软开发的,Win10及以上系统自带的浏览器</p><p><a href="//www.microsoft.com/zh-cn/edge" target="_blank" rel="noreferrer">官网地址</a></p><p>这一篇是写<strong>JS</strong>的,绝大部分需要在浏览器的控制台(F12)中查看效果</p><h2 id="编辑器" tabindex="-1">编辑器 <a class="header-anchor" href="#编辑器" aria-label="Permalink to &quot;编辑器&quot;">​</a></h2><p>推荐使用<strong>Sublime Text</strong>,<strong>WebStorm</strong>,<strong>HBuilder</strong>,<strong>Visual Studio Code</strong></p><p>教程中使用<strong>Visual Studio Code(VS Code)</strong></p><p><strong>VS Code</strong>是由微软开发的免费开源的代码编辑器(我更喜欢归为文本编辑器)</p><p>它支持多种编程语言,拥有丰富的扩展生态系统,并且几乎全平台</p><p>安装的时候,记得关联文件资源管理器就可以了</p><p>详细可看VS Code的那篇教程</p><p><a href="//code.visualstudio.com/" target="_blank" rel="noreferrer">官网地址</a></p><h3 id="vs-code插件" tabindex="-1">VS Code插件 <a class="header-anchor" href="#vs-code插件" aria-label="Permalink to &quot;VS Code插件&quot;">​</a></h3><p>VS Code需要安装两个插件</p><p>点击侧边栏的这个图标(Ctrl + Shift + X) <img src="'+n+'" alt="120077f19333cd032aabee6acb512e3a9b46543a" data-fancybox="gallery" loading="lazy"></p><h4 id="中文汉化" tabindex="-1">中文汉化 <a class="header-anchor" href="#中文汉化" aria-label="Permalink to &quot;中文汉化&quot;">​</a></h4><p>第一个:<code>Chinese (Simplified) (简体中文) Language Pack for Visual Studio Code</code></p><p><img src="'+A+'" alt="3341a5467c2746cfc269f63774544d084227b34a" data-fancybox="gallery" loading="lazy"></p><p>用于汉化VS Code,属于选装插件</p><h4 id="内网服务器" tabindex="-1">内网服务器 <a class="header-anchor" href="#内网服务器" aria-label="Permalink to &quot;内网服务器&quot;">​</a></h4><p>第二个:<code>Live Server</code></p><p><img src="'+d+'" alt="c60d460b2fb7680609a67b5ba0914a2004e56a89" data-fancybox="gallery" loading="lazy"></p><p>这个插件可以创建一个内网,用于实时更新网页代码等</p><p>在<code>.html</code>或者<code>.htm</code>后缀的文件,右键鼠标,可以看见右键菜单里,多了两项</p><p><img src="'+c+'" alt="2555872dce8f9575a7e5055980103a1f011bbb4b" data-fancybox="gallery" loading="lazy"></p><p>Open with Live Server 是打开网页</p><p>Stop Live Server 就是关闭了</p><p>正常来说,打开网页后,浏览器会自动跳转,没有自动跳转也没关系,在浏览器输入内网网址也可以,默认为<code>http://localhost:5500</code></p><p>5500是端口号,在VS Code右下角可以看见,点击这个也可以关闭或打开网页</p><p><img src="'+p+'" alt="2e8527ef36a52316ee330749b6b8b1b30dbe4169" data-fancybox="gallery" loading="lazy"></p>',33)]))}const m=e(s,[["render",g]]);export{v as __pageData,m as default};
